   "photo":"../../photos/georgeTraxelFrame.png",
   "description": "The story of this couple starts before they ever met. Both came from less-than-ideal childhoods which could explain the volatile nature of their marriage.\n \n   George Edward Traxel was born in St. Louis, Missouri on 13 NOV 1911, the 1st child of William Otto Traxel (age 20) and Louise Brown (age 17). Not much is known of his early childhood except a newspaper article that reports the following: “George Traxel, 5 years old of 458 Swan Avenue, was run down by a horse and buggy in front of 4262 Manchester Avenue yesterday afternoon and seriously injured. The driver did not stop but whipped up his horse and continued west. The wheels passed over the child, fracturing his nose and causing internal injuries. He was taken home.”  Family legend reports that his father, William wasn’t a very nice person and he and his mother divorced when George was 11 years old.\n \n  Lucille Rose Bujnak Noblot was born in St. Louis, Missouri on 9 SEP 1911, the 4th child of Austria-Hungarian immigrants Jacob Bujnak (age 35, Slovinian) and Filomena Brunat. (age 33, Bohemian). Sadly, Lucille’s mother died shortly after her birth. Jacob, with 3 other children wasn’t prepared to also care for an infant. Philomena’s sister, Anna Brunat Noblot (age with 37) and her husband Joseph Noblot (age 53), a butcher by trade, who had 4 children ranging in age from 10 to 15, took the baby to raise as their own. Anna’s extended family the Brunats were a tightknit group all having immigrated together living in the same neighborhood in St. Louis.\n \n  Life was seemingly happy until Christmas of 1917. There was an argument between Anna and her husband Joseph. Anna left with Lucille and went to stay with her sister Rose who was married to Frank Masek. Days went by and when his wife didn’t return home, Joseph went to the Masek home in the middle of the night and shot his wife, her sister and brother-in-law. Anna Noblot died of the gunshot wound a few hours later. Rose and Frank recovered eventually. After leaving the home Joseph Noblot went to his other bother-in-law Joseph Brunat’s home and confessed to the shooting saying he was going to turn himself in. He then went home and cut his throat with a butcher’s knife in front of his children. This gruesome story really affected Lucille as years later she told her children she remembered she hid in a dress form to avoid being shot. She was just 6 years old at the time.\n \n  But this isn’t the end of Lucille’s sad childhood. With her biological mother dead and now her adoptive parents also dead, it was up to her Aunt Rose and Uncle Frank Masek to take her in to live with them. She is found on the 1920 census with them and their 16 year old daughter Anna seemingly resuming her childhood in her new family. But at an unknown time after that she was placed in Hessoun Bohemian Catholic Orphanage.  Lucille told a story of how one day some neighbors complained about her living with them and that’s when she was sent to live at the orphanage. After a little digging I found that Frank Masek had been committed to a Sanitarium and Rose divorced him, remarried a man named George Yates and moved to Edwardsville, Illinois in 1925. \n \n  By this time, her biological father, Jacob Bujnak was married to his second wife, Mary, had 2 more children and was living in Illinois. No one has an answer as to why he did not take his daughter into his new family. Perhaps, his wife did not want to take care of another child? Lucille remembered him visiting her around Easter time and he gave her a white chocolate bunny which she said the nuns took away from her. She told another story about how the nuns made her sell gooseberries in St Louis to raise funds for the orphanage. She got in trouble because she ate the berries. When asked why her explanation was that she wasn’t an orphan because her father was still alive. She went to bed without dinner that day.\n \n  George and Lucille met at The Arcadia Ball Room in St. Louis, a favorite hangout for young people of the day. They married June 14, 1932 in Bellville, Illinois.",
