   "photo": "../../photos/henryVonBehren.png",
   "description":"Henry C Von Behren was born in Kentucky on 15 DEC 1864, the 3rd child of German immigrants Kort Heinrich Von Behren (age 41) and Christina Telljohann (age 34) both from Nordhemmern, North Rhine-Westphalia Germany. The Von Behren family lived in Kentucky and was on their way to Missouri to settle a farm under the homestead act. When Kort died, Henry was the eldest son, and in position to inherit the family farm. However, he had 5 siblings. To pay their share of the inheritance, Henry took a mortgage on the farm. Given the hilly terrain and poor soil, the repayments were difficult to keep up with. However, when the family began producing Molasses, they hit on a formula for success. Henry’s Grandson Erwin Jr. talks of still (in the 1950s) being able to see the track worn in the ground where the horses worked to spin the press to make the molasses. \n \n   Matilda Rohlfing was born in Berger, Missouri on 29 JAN 1869, to Friedrich Pehle (age 50) and Christina Maria Meier (age 39). \n \n   Henry and Matilda \n \n   They married on 19 NOV 1891 in Big Berger, Missouri. They had 2 sons (Louis and Erwin) and 2 daughters (Ida and Luella). Matilda died in 1950 at age 81 and Henry died in 1957 at age 92.",
